import React from 'react';

const Privilige = () => {
    return (
        <div>
            <h2 className="text-2xl font-bold mb-4">Paramètres</h2>
            <p>Modifiez ici vos paramètres.</p>
            <div className="bg-white p-4 shadow-md rounded-md">
                <h3 className="font-semibold">Gestion de Profil</h3>
                <p>Vous pouvez modifier votre nom d'utilisateur et mot de passe</p>
                <button className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700">Modifier mes informations</button>
            </div>
        </div>
    );
};

export default Privilige;
